import React from 'react'
import PropTypes from 'prop-types';
function New1(props) {
  return (
    <>
 <div className="col full p2 line">
    <h2>Component1</h2>
    <h1>{props.name}</h1>
    <h1>{props.age}</h1>
 </div>
    </>
  )
}
New1.propTypes = {
    name: PropTypes.string,
    age: PropTypes.number,
  };
export default New1
